import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import './brand.css';
import { html5, css, js, bootstrap, react, nodejs, phplogo} from './imports';

const Brand = () => {
    return (
        <Container fluid className="profile__brand section__padding">
            <Row className="profile__brand__container">
                <Col>
                    <img src={html5} alt="html5" />
                </Col>
                <Col>
                    <img src={css} alt="css" />
                </Col>
                <Col>
                    <img src={js} alt="js" />
                </Col>
                <Col>
                    <img src={bootstrap} alt="bootstrap" />
                </Col>
                <Col>
                    <img src={react} alt="react" />
                </Col>
                <Col>
                    <img src={nodejs} alt="nodeJs"/>
                </Col>
                <Col>
                    <img src={phplogo} alt="phplogo"/>
                </Col>
                {/* Add more Col components for additional images */}
            </Row>
        </Container>
    );
}

export default Brand;
